&quot;26th: Clear day staid at Murphys Shanty all day posting books. L O'Brien walked to Genaroux from Murphys.&quot;

&quot;27th: Dark cloudy day snowed a little after noon verry soft. Looked like Rain. Went out to woods with Murphy after dinner went to road cutters &amp; skidders Murphy found Jack Knife on large pine log got back to Shanty at 2 p.m. Staid all day posting book plaid cards at night won 8 plugs tobac from J. Hayes &amp; Jo Doyle Jim Murphy won the same.&quot;

&quot;28th: Dark cloudy day snowed quite a lot. Staid all day at Murphys Shanty posting books. Snowed verry near all day and all night.&quot;

&quot;29th: Sunday - dark cloudy day in fournoon snowed verry heavy in after noon cleard off until 1/2 past 2 very heavy squall of snow lasted about 1/2 an hour and continued on light until night. Sun shone for a little while wind raised about night and turned cold. Jas Ward left Shanty at noon walked to Genarouxs Shanty 10 miles for an ox.&quot;

Part of Denis Nealon's diary.
